{"version":3,"sources":["menu_toggle.js"],"names":["$","document","ready","click","this","classList","contains","removeClass","addClass"],"mappings":"AAIAA,EAAEC,UAAUC,MAAM,WAChBF,EAAE,gBAAgBG,MAAM,WACnBC,KAAKC,UAAUC,SAAS,gBAAe,GAExCN,EAAE,qBAAqBO,YAAY,aACnCP,EAAE,mBAAmBO,YAAY,aAIjCP,EAAE,qBAAqBQ,SAAS,aAChCR,EAAE,mBAAmBQ,SAAS","file":"menu_toggle.js","sourcesContent":["/**\n * Created by jakobrindom on 28/08/15.\n */\n\n$(document).ready(function () {\n  $('.c-hamburger').click(function() {\n    if(this.classList.contains(\"is-active\")===true){\n      //this.classList.remove(\"is-active\");\n      $('.c-hamburger--htx').removeClass(\"is-active\");\n      $('.hamburger-menu').removeClass(\"is-open\");\n    }\n    else {\n      //this.classList.add(\"is-active\");\n      $('.c-hamburger--htx').addClass(\"is-active\");\n      $('.hamburger-menu').addClass(\"is-open\");\n    }\n  });\n});\n\n\n\n"],"sourceRoot":"/source/"}